import React, { useState } from 'react';
import { useEffect } from 'react';
import { Link } from 'react-router-dom';

import Sidebar from '../../../../sidebar/Sidebar';
import EditBorrower from './EditBorrower';

import {
  LocationOnOutlined,
  MailOutline,
  PermIdentity,
  PhoneAndroid,
  Publish,
} from '@mui/icons-material';

export default function Borrower({ setAuth }) {
  const [id, setId] = useState();
  const [name, setName] = useState();
  const [contactnumber, setContactNumber] = useState();
  const [address, setAddress] = useState();
  const [email, setEmail] = useState();
  const [username, setUsername] = useState();

  const getProfile = async (params) => {
    try {
      const response = await fetch('http://localhost:8000/profile', {
        method: 'GET',
        headers: { Authorization: localStorage.getItem('token') },
      });

      const parseRes = await response.json();
      // console.log(parseRes);

      setId(parseRes.id);
      setName(parseRes.firstname + ' ' + parseRes.lastname);
      setContactNumber(parseRes.contactnumber);
      setAddress(parseRes.address);
      setUsername(parseRes.username);
      setEmail(parseRes.email);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    const interval = setInterval(() => {
      getProfile();
    }, 1000);
    return () => clearInterval(interval);
  }, []);
  return (
    <div className='flex flex-1 flex-column w-screen'>
      <Sidebar />

      {/* BORROWER INFO */}
      <div className='py-5 px-5 w-full'>
        <div className='px-4 py-5 sm:px-6 bg-red-500'>
          <h3 className='text-lg font-medium leading-6 text-white'>
            Borrower Info
          </h3>
          <p className='mt-1 max-w-2xl text-sm text-white'>
            All clients personal information
          </p>
        </div>

        {/* TOP */}
        <div className='flex mt-5 w-full'>
          <div className='py-5 px-5 shadow-md h-full w-fit'>
            <div className='flex items-center justify-between py-5 px-5'>
              <img
                src='https://cdn3.iconfinder.com/data/icons/red-icons-1/512/Male-profile-icon-512.png'
                alt=''
                className='w-2/5 h-2/5'
              />
              <div className=''>
                <span className='text-base font-semibold mt-10 text-gray-500'>
                  Account Details
                </span>
                <div className='flex items-center my-5'>
                  <PermIdentity className='text-lg' />
                  <span className='ml-2.5'>cody13</span>
                </div>
                <div className='flex items-center my-5'>
                  <MailOutline className='text-lg ' />
                  <span className='ml-2.5'>cody13@gmail.com</span>
                </div>
                <div className='flex items-center my-5'>
                  <LocationOnOutlined className='text-lg ' />
                  <span className='ml-2.5'>Legazpi City</span>
                </div>
                <div className='flex items-center my-5'>
                  <PhoneAndroid className='text-lg ' />
                  <span className='ml-2.5'>111333</span>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* UPDATE */}
        <div className='userUpdate'>
          <span className='userUpdateTitle'>Edit</span>
          <span className='userUpdateForm'>
            <div className='userUpdateLeft'>
              {/* FIRSTNAME */}
              <div className='userUpdateItem'>
                <label htmlFor=''>First Name</label>
                <input
                  type='text'
                  placeholder='Input first name'
                  className='userUpdateInput'
                />
              </div>

              {/* LASTNAME */}
              <div className='userUpdateItem'>
                <label htmlFor=''>Last Name</label>
                <input
                  type='text'
                  placeholder='Input last name'
                  className='userUpdateInput'
                />
              </div>

              {/* USERNAME */}
              <div className='userUpdateItem'>
                <label htmlFor=''>Username</label>
                <input
                  type='text'
                  placeholder='Input username'
                  className='userUpdateInput'
                />
              </div>

              {/* EMAIL */}
              <div className='userUpdateItem'>
                <label htmlFor=''>Email</label>
                <input
                  type='text'
                  placeholder='Input email'
                  className='userUpdateInput'
                />
              </div>

              {/* ADDRESS */}
              <div className='userUpdateItem'>
                <label htmlFor=''>Address</label>
                <input
                  type='text'
                  placeholder='Input address'
                  className='userUpdateInput'
                />
              </div>

              {/* PHONE NUMBER */}
              <div className='userUpdateItem'>
                <label htmlFor=''>Phone Number</label>
                <input
                  type='text'
                  placeholder='Input phone number'
                  className='userUpdateInput'
                />
              </div>
            </div>
            {/* <div className='userUpdateRight'>
              <div className='userUpdateUpload'>
                <img
                  src='https://cdn3.iconfinder.com/data/icons/red-icons-1/512/Male-profile-icon-512.png'
                  alt=''
                  className='userUpdateImg'
                />
                <label htmlFor='file'>
                  <Publish className='userUpdateIcon' />
                </label>
                <input type='file' id='file' style={{ display: 'none' }} />
              </div>
              <button className='userUpdateButton'>Update</button>
            </div> */}
          </span>
        </div>
      </div>
    </div>
  );
}
